import './App.css';
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { routes } from './routes';
import { ResultContext } from './helpers/ResultContext'
import { useState } from 'react'
/**
 *
 * @returns {*}
 * @constructor
 */
const App = () => {

  const resultInitialState = {
    items: [],
    categories: [],
  }
  const [results, setResults] = useState(resultInitialState);

  return (
    <React.Fragment>
      <div id={`Meli`} className={``}>
        <BrowserRouter >
          <div className={``}>
            <Routes>
              {Object.keys(routes()).map((element, index) => {
                const RouterComponent = routes()[element].component;
                return <Route key={index} exact path={element} element={<RouterComponent />} />;
              })}
            </Routes>
          </div>
        </BrowserRouter>
      </div>
    </React.Fragment>
  );
};

export default App;
